  `distribution` tinyint(3) NULL DEFAULT 30 COMMENT '分钟  配送时间',
  `audit` tinyint(3) UNSIGNED NULL DEFAULT 0 COMMENT '0审核中1成功入驻2未通过',
  `rate` int(11) NULL DEFAULT 60 COMMENT '费率 每个商品的结算价格',
  PRIMARY KEY (`shop_id`) USING BTREE
