  `log_id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `create_time` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '创建时间',
  `user_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '会员UID',
  `money` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '月度帮扶差旅补贴',
  `is_separate` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否发奖 1 已发 0 未发 2已取消',
  `shifoudabiao` varchar(100) CHARACTER SET gbk COLLATE gbk_chinese_ci NULL DEFAULT '' COMMENT '是否达标消息',
  `yuedu` int(11) NULL DEFAULT 0 COMMENT '月度消费总钱数',
  `rijun` int(11) NULL DEFAULT 0 COMMENT '日均',
  `bg_time` int(11) NULL DEFAULT 0 COMMENT '起始时间 年月一号时间戳',
  `end_time` int(11) NULL DEFAULT 0 COMMENT '截止时间 年月一号时间戳',
  `tianshu` int(3) NULL DEFAULT 0 COMMENT '当月天数',
  `intro` varchar(100) CHARACTER SET gbk COLLATE gbk_chinese_ci NULL DEFAULT '' COMMENT '消息 奖名称',
  `edit_time` int(10) NULL DEFAULT 0 COMMENT '发放时间',
  PRIMARY KEY (`log_id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 1 CHARACTER SET = gbk COLLATE = gbk_chinese_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for bao_users
-- ----------------------------
DROP TABLE IF EXISTS `bao_users`;
CREATE TABLE `bao_users`  (
  `user_id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `account` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '邮件或者手机',
  `password` char(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `pay_password` char(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `face` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `ext0` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '为了兼容DISCUZ 设立的用户名存储的字段',
  `nickname` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `integral` int(11) NULL DEFAULT 0,
  `prestige` int(11) NULL DEFAULT 0 COMMENT '声望，影响等级的',
  `money` int(11) NULL DEFAULT 0 COMMENT '账户余额',
  `rank_id` tinyint(4) NULL DEFAULT 1 COMMENT '等级ID',
  `gold` int(11) NULL DEFAULT 0,
  `frozen_money` int(11) NULL DEFAULT NULL COMMENT '会员余额-冻结金',
  `frozen_gold` int(11) NULL DEFAULT NULL COMMENT '冻结金-商家资金',
  `reg_time` int(11) NULL DEFAULT 0,
  `reg_ip` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `last_time` int(11) NULL DEFAULT NULL,
  `frozen_money_time` int(11) NULL DEFAULT NULL COMMENT '会员余额-冻结金修改时间',
  `frozen_gold_time` int(11) NULL DEFAULT NULL COMMENT '修改商家资金冻结时间',
  `closed` tinyint(1) NULL DEFAULT 0 COMMENT '-1代表需要激活   0 代表正常  1 代表删除',
  `uc_id` int(11) NULL DEFAULT 0,
  `email` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '认证的邮件',
  `mobile` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '认证的手机号码',
  `ping_num` int(11) NULL DEFAULT 0,
  `post_num` int(11) NULL DEFAULT 0,
  `lock_num` int(11) NULL DEFAULT 0,
  `invite1` int(11) NULL DEFAULT NULL,
  `invite2` int(11) NULL DEFAULT NULL,
  `invite3` int(11) NULL DEFAULT NULL,
  `invite4` int(11) NULL DEFAULT NULL,
  `invite5` int(11) NULL DEFAULT NULL,
  `invite6` int(11) NULL DEFAULT 0,
  `token` char(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0',
  `fuid1` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `fuid2` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `fuid3` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `is_lock` tinyint(1) NULL DEFAULT 0,
  `is_lock_time` int(11) NULL DEFAULT NULL,
  PRIMARY KEY (`user_id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 2 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

